class Solution {
    func lastSubstring(_ s: String) -> String {
        guard !s.isEmpty else {
            return ""
        }
        let count = s.count
        let charArray = Array(s)
        var maxIndex = 0
        for i in 1..<s.count {
            var length = 0
            while i + length < count {
                if charArray[maxIndex + length] == charArray[i + length] {
                    length += 1
                    continue
                }
                maxIndex = charArray[i + length] > charArray[maxIndex + length] ? i : maxIndex
                break
            }
            if i + length == count {
                break
            }
        }
        return String(charArray[maxIndex...])
    }
}

